01-1 텍스트 전처리

---

## 01-1 텍스트 전처리

- **텍스트 전처리**
  - 텍스트에서 분석하는 데 불필요한 요소를 제거하고 다루기 쉬운 형태로 만드는 과정


#### 연설문 불러오기


```r
raw_moon &lt;- readLines(&quot;speech_moon.txt&quot;, encoding = &quot;UTF-8&quot;)
head(raw_moon)
```



```
## [1] &quot;정권교체 하겠습니다!&quot;                                                                                                                                                              
## [2] &quot;  정치교체 하겠습니다!&quot;                                                                                                                                                            
## [3] &quot;  시대교체 하겠습니다!&quot;                                                                                                                                                            
## [4] &quot;  &quot;                                                                                                                                                                                
## [5] &quot;  ‘불비불명(不飛不鳴)’이라는 고사가 있습니다. 남쪽 언덕 나뭇가지에 앉아, 3년 동안 날지도 울지도 않는 새. 그러나 그 새는 한번 날면 하늘 끝까지 날고, 한번 울면 천지를 뒤흔듭니다.&quot;
## [6] &quot;&quot;
```

- 문재인 대통령의 대선 출마 선언문 출처: [bit.ly/easytext_11](https://bit.ly/easytext_11)

---

#### 불필요한 문자 제거하기 - `str_replace_all()`

분석 대상이 아닌 문자 제거 - 특수문자, 한자, 공백 등


##### 샘플 텍스트로 작동 원리 알아보기

- `string` : 처리할 텍스트
- `pattern` : 규칙
- `replacement` : 바꿀 문자


```r
txt &lt;- &quot;치킨은!! 맛있다. xyz 정말 맛있다!@#&quot;
txt
```

```
## [1] &quot;치킨은!! 맛있다. xyz 정말 맛있다!@#&quot;
```

--


```r
install.packages(&quot;stringr&quot;)
library(stringr)

str_replace_all(string = txt, pattern = &quot;[^가-힣]&quot;, replacement = &quot; &quot;)
```


```
## [1] &quot;치킨은   맛있다      정말 맛있다   &quot;
```

---

#### 정규 표현식이란?

- 특정한 규칙을 가진 문자열을 표현하는 언어
- 특정 조건의 문자를 찾거나 수정할 때 활용
- ex) `[^가-힣]` : 한글이 아닌 모든 문자
    - `가-힣` : &quot;가&quot; 부터 &quot;힣&quot;까지의 모든 한글 문자
    - `^` : 반대
- [참고] 정규 표현식 패턴들(오픈튜토리얼스): [bit.ly/easytext_12](https://bit.ly/easytext_12)

---

#### `raw_moon`의 불필요한 문자 제거하기


```r
moon &lt;- raw_moon %&gt;%
 str_replace_all(&quot;[^가-힣]&quot;, &quot; &quot;)

head(moon)
```

```
## [1] &quot;정권교체 하겠습니다 &quot;                                                                                                                                                        
## [2] &quot;  정치교체 하겠습니다 &quot;                                                                                                                                                      
## [3] &quot;  시대교체 하겠습니다 &quot;                                                                                                                                                      
## [4] &quot;  &quot;                                                                                                                                                                          
## [5] &quot;   불비불명       이라는 고사가 있습니다  남쪽 언덕 나뭇가지에 앉아   년 동안 날지도 울지도 않는 새  그러나 그 새는 한번 날면 하늘 끝까지 날고  한번 울면 천지를 뒤흔듭니다 &quot;
## [6] &quot;&quot;
```

---


#### 연속된 공백 제거하기 - `str_squish()`

##### 샘플 텍스트로 작동 원리 알아보기



```r
txt &lt;- &quot;치킨은  맛있다   정말 맛있다  &quot;
txt
```

```
## [1] &quot;치킨은  맛있다   정말 맛있다  &quot;
```

--


```r
str_squish(txt)
```

```
## [1] &quot;치킨은 맛있다 정말 맛있다&quot;
```

---

##### `moon`에 있는 연속된 공백 제거하기


```r
moon &lt;- moon %&gt;%
 str_squish()

head(moon)
```

```

## [4] &quot;&quot;                                                                                                                                                             
## [5] &quot;불비불명 이라는 고사가 있습니다 남쪽 언덕 나뭇가지에 앉아 년 동안 날지도 울지도 않는 새 그러나 그 새는 한번 날면 하늘 끝까지 날고 한번 울면 천지를 뒤흔듭니다&quot;

##### tibble 구조
- 한 행에 한 단락이 들어있음
- 긴 문장은 Console 창에서 보기 편할 만큼 일부만 출력
- 행과 열의 수를 알 수 있음
- 변수의 자료형을 알 수 있음

---

#### 전처리 작업 한 번에 하기


```r
moon &lt;- raw_moon %&gt;%
 str_replace_all(&quot;[^가-힣]&quot;, &quot; &quot;) %&gt;%  # 한글만 남기기
 str_squish() %&gt;%                      # 연속된 공백 제거
 as_tibble()                           # tibble로 변환
```

## 01-2 토큰화하기

- 토큰(token): 텍스트의 기본 단위(ex: 단락, 문장, 단어, 형태소)

- 토큰화(tokenization): 텍스트를 토큰으로 나누는 작업

---

#### 토큰화하기 - `unnest_tokens()`

- `tidytext` 패키지
  - 텍스트를 정돈된 데이터(Tidy Data) 형태를 유지하며 분석
  - `dplyr`, `ggplot2` 패키지와 함께 활용

---

##### 샘플 텍스트로 작동 원리 알아보기


```r
text &lt;- tibble(value = &quot;대한민국은 민주공화국이다. 대한민국의 주권은 국민에게 있고, 모든 권력은 국민으로부터 나온다.&quot;)

text
```

```
## # A tibble: 1 x 1
##   value                                                               
##   &lt;chr&gt;                                                               
## 1 대한민국은 민주공화국이다. 대한민국의 주권은 국민에게 있고, 모든 권력은 국민으로부터 나온다.~
```

---


```r
install.packages(&quot;tidytext&quot;)
library(tidytext)

# 문장 기준 토큰화
text %&gt;%
  unnest_tokens(input = value,        # 토큰화할 텍스트
                output = word,        # 토큰을 담을 변수명
                token = &quot;sentences&quot;)  # 토큰화 기준
```


```
## # A tibble: 2 x 1
##   word                                                             
##   &lt;chr&gt;                                                            
## 1 대한민국은 민주공화국이다.                                       
## 2 대한민국의 주권은 국민에게 있고, 모든 권력은 국민으로부터 나온다.
```

- `token`
  - `&quot;sentences&quot;` : 문장
  - `&quot;words&quot;` : 띄어쓰기
  - `&quot;characters&quot;` : 글자

---


```r

  unnest_tokens(input = value,
                output = word,
                token = &quot;words&quot;)      # 띄어쓰기 기준
```

## 01-3 단어 빈도 분석하기

##### 한 번에 작업하기

- 빈도 내림차순 정렬 후 두 글자 이상 단어 남기기


```r
word_space &lt;- word_space %&gt;%
 count(word, sort = T) %&gt;%
 filter(str_count(word) &gt; 1)

#### 워드 클라우드 만들기

- 워드 클라우드(Word cloud)
    - 단어 빈도를 구름 모양으로 표현한 그래프
    - 빈도에 따라 글자 크기와 색을 다르게 표현
    - 어떤 단어가 얼마나 많이 사용됐는지 한눈에 파악

---


##### 워드 클라우드 만들기 - `geom_text_wordcloud()`


```r
install.packages(&quot;ggwordcloud&quot;)
library(ggwordcloud)

ggplot(word_space, aes(label = word, size = n)) +
 geom_text_wordcloud(seed = 1234) +
 scale_radius(limits = c(3, NA),     # 최소, 최대 단어 빈도
              range = c(3, 30))      # 최소, 최대 글자 크기
```

&lt;img src=&quot;data:image/png;base64,#https://raw.githubusercontent.com/youngwoos/Doit_textmining/main/Image/01/01_3_3.png&quot; width=&quot;40%&quot; height=&quot;40%&quot; /&gt;

- [참고] Plots 창 크기에 따라 그래프 모양 달라짐

---

##### 그래프 다듬기


```r
ggplot(word_space,
       aes(label = word,
           size = n,
           col = n)) +                     # 빈도에 따라 색깔 표현
 geom_text_wordcloud(seed = 1234) +
 scale_radius(limits = c(3, NA),
              range = c(3, 30)) +
 scale_color_gradient(low = &quot;#66aaf2&quot;,     # 최소 빈도 색깔
                      high = &quot;#004EA1&quot;) +  # 최고 빈도 색깔
 theme_minimal()                           # 배경 없는 테마 적용
```

### 그래프 폰트 바꾸기


##### 1. 구글 폰트 불러오기 - `font_add_google()`


```r
install.packages(&quot;showtext&quot;)

showtext_auto()
```

##### 2. 그래프에 폰트 지정하기


```r
ggplot(word_space,
       aes(label = word,
           size = n,
           col = n)) +
  geom_text_wordcloud(seed = 1234,
                      family = &quot;nanumgothic&quot;) +  # 폰트 적용
  scale_radius(limits = c(3, NA),
               range = c(3, 30)) +
  scale_color_gradient(low = &quot;#66aaf2&quot;,
                       high = &quot;#004EA1&quot;) +
  theme_minimal()

#### [알아두면 좋아요] `ggplot2` 기본 테마 폰트 변경하기

- 매번 `theme()`을 이용해 폰트를 지정하는게 번거롭다면 `ggplot2` 패키지 기본 테마 폰트 설정


```r
theme_set(theme_gray(base_family = &quot;nanumgothic&quot;))
```

- 테마 바꾸는 함수 사용하면 폰트가 기본값으로 되돌아감. 이 경우 `theme()`을 이용해 폰트 직접 지정
  - ex) `theme_minimal()`, `theme_bw()`
